// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract EHRSystem {
    address private admin;
    uint256 private organizationCount;
    uint256 private doctorCount;
    uint256 private patientCount;

    struct Organization {
        string name;
        address hospitalAddress;
        mapping(address => bool) doctors;
        mapping(address => bool) patientsVisited;
    }

    struct Doctor {
        string name;
        string department;
        address docaddress;
        address[] associatedHospitals;
        address chosenHospital;
    }

    struct Patient {
        string name;
        uint256 age;
        uint256 dob;
        uint256 aadharnumber;
        uint256 height;
        uint256 weight;
        string addressInfo;
        string phoneNumber;
    }

    struct MedicalRecord {
        string report;
        string prescription;
        uint256 timestamp;
        address doctor;
        address hospital;
    }

    mapping(address => Organization) private organizations;
    mapping(address => Doctor) private doctors;
    mapping(address => Doctor) private hospitalDoctors;
    mapping(uint256 => Patient) private patients;
    mapping(uint256 => address) private aadharToPatient;
    mapping(uint256 => mapping(address => MedicalRecord[])) private patientMedicalRecords;

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier onlyOrganization() {
        require(organizations[msg.sender].doctors[msg.sender], "Only organization members can perform this action");
        _;
    }

    modifier onlyDoctor() {
        require(doctors[msg.sender].associatedHospitals.length > 0, "Doctor must be associated with at least one hospital");
        require(organizations[doctors[msg.sender].associatedHospitals[0]].doctors[msg.sender], "Only doctors of the organization can perform this action");
        _;
    }

    modifier onlyPatient(uint256 _aadharNumber) {
        require(aadharToPatient[_aadharNumber] == msg.sender, "You can only access your own records");
        _;
    }

    constructor() {
        admin =msg.sender;
        organizationCount = 0;
        doctorCount = 0;
        patientCount = 0;
    }

    function addOrganization(string memory _name, address _hospitalAddress) external onlyAdmin {
        organizations[msg.sender].name = _name;
        organizations[msg.sender].hospitalAddress = _hospitalAddress;
        organizationCount++;
    }

    function addDoctor(string memory _name, string memory _department, address _docaddress) external onlyAdmin {
        doctors[_docaddress].name = _name;
        doctors[_docaddress].department = _department;
        doctors[_docaddress].docaddress = _docaddress;
        doctorCount++;
    }

    function associateDoctorWithHospital(address _hospitalAddress) external onlyDoctor {
        require(organizations[_hospitalAddress].doctors[msg.sender], "Doctor is not associated with the hospital");
        doctors[msg.sender].associatedHospitals.push(_hospitalAddress);
    }

    function addDoctorToHospital(address _doctorAddress, address[] calldata _associatedHospitals) external onlyOrganization {
        require(doctors[_doctorAddress].docaddress != address(0), "Doctor not found in general list");
        hospitalDoctors[_doctorAddress] = doctors[_doctorAddress];
        hospitalDoctors[_doctorAddress].associatedHospitals = _associatedHospitals;
    }

    function getDoctorAssociatedHospitals() external view returns (address[] memory) {
        require(doctors[msg.sender].docaddress != address(0), "Doctor not found in general list");
        return doctors[msg.sender].associatedHospitals;
    }

     function isDoctorAssociatedWithHospital(address _doctorAddress, address _hospitalAddress) internal view returns (bool) {
        for (uint256 i = 0; i < doctors[_doctorAddress].associatedHospitals.length; i++) {
            if (doctors[_doctorAddress].associatedHospitals[i] == _hospitalAddress) {
                return true;
            }
        }
        return false;
    }

    function registerPatient(string memory _name, uint256 _age, uint256 _dob, uint256 _aadharnumber, uint256 _height, uint256 _weight, string memory _addressInfo, string memory _phoneNumber) external {
        require(_age > 0 && _dob > 0 && _height > 0 && _weight > 0, "Invalid patient details");
        require(aadharToPatient[_dob] == address(0), "Patient already registered");
        
        patients[_aadharnumber] = Patient(_name, _age, _dob, _aadharnumber, _height, _weight, _addressInfo, _phoneNumber);
        aadharToPatient[_aadharnumber] = msg.sender;
        patientCount++;
    }
    
    function displayDoctor(address _doctorAddress) external view returns (string memory, string memory) {
        require(doctorCount > 0, "No doctors registered yet");
        require(_doctorAddress != address(0), "Invalid doctor address");

        return (doctors[_doctorAddress].name, doctors[_doctorAddress].department);
    }


   function getPatientDetails(uint256 _aadharNumber) external view onlyPatient(_aadharNumber)
    returns (string memory, uint256, uint256, uint256, uint256, string memory, string memory) {
        Patient memory patient = patients[_aadharNumber];
        return (
            patient.name,
            patient.age,
            patient.dob,
            patient.height,
            patient.weight,
            patient.addressInfo,
            patient.phoneNumber
        );
    }

    function chooseHospital(address _hospitalAddress) external onlyDoctor {
        require(hospitalDoctors[msg.sender].docaddress != address(0), "Doctor not found in general list");
        require(isDoctorAssociatedWithHospital(msg.sender, _hospitalAddress), "Doctor not associated with this hospital");
        hospitalDoctors[msg.sender].chosenHospital = _hospitalAddress;
    }

//    function addMedicalRecord(
//         string calldata _report,
//         string calldata _prescription,
//         uint256 _aadharNumber
//     ) external onlyDoctor {
//         require(hospitalDoctors[msg.sender].chosenHospital != address(0), "Doctor has not chosen a hospital");
//         // Check if the patient is registered
//         require(patients[_aadharNumber].isRegistered, "Patient not registered");
//         // Ensure that the doctor is associated with the chosen hospital
//         require(isDoctorAssociatedWithHospital(msg.sender, hospitalDoctors[msg.sender].chosenHospital), "Doctor not associated with chosen hospital");

//         patientMedicalRecords[_aadharNumber][msg.sender].push(
//             MedicalRecord({
//                 report: _report,
//                 prescription: _prescription,
//                 timestamp: block.timestamp,
//                 doctor: msg.sender,
//                 hospital: hospitalDoctors[msg.sender].chosenHospital
//             })
//         );
//     }


    function getPatientMedicalRecords(uint256 _aadharNumber) external view onlyPatient(_aadharNumber)
    returns (MedicalRecord[] memory) {
        return patientMedicalRecords[_aadharNumber][aadharToPatient[_aadharNumber]];
    }
}

